create table if not exists passports (
	id INTEGER PRIMARY KEY AUTOINCREMENT,
	ssn VARCHAR(50),
	name VARCHAR(50),
	gender VARCHAR(6),
	DOB DATE,
	height INT,
	hair_color VARCHAR(6),
	nationality VARCHAR(50)
);

CREATE TABLE if not exists animals (
	id INTEGER PRIMARY KEY AUTOINCREMENT,
	name VARCHAR,
	breed VARCHAR,
	vaccinated BOOLEAN,
	passport_id INTEGER,
	
	FOREIGN KEY (passport_id) REFERENCES passports(id)
);

CREATE TABLE if not exists departures (
	id INTEGER PRIMARY KEY AUTOINCREMENT,
	airline VARCHAR,
	flight_number VARCHAR,
	destination VARCHAR,
	departure_at DATETIME
);

CREATE TABLE if not exists travelers (
	id INTEGER PRIMARY KEY AUTOINCREMENT,
	passport_id INTEGER,
	departure_id INTEGER,
	
	FOREIGN KEY (passport_id) REFERENCES passport(id),
	FOREIGN KEY (departure_id) REFERENCES departures(id)
);

CREATE TABLE if not exists staff (
	id INTEGER PRIMARY KEY AUTOINCREMENT,
	name VARCHAR,
	department VARCHAR,
	last_shift DATETIME,
	hired_at DATE
);

CREATE TABLE if not exists security_observation (
	id INTEGER PRIMARY KEY AUTOINCREMENT,
	observation TEXT,
	staff_member INTEGER,
	created_at DATETIME,
	caution_level INTEGER,
	
	FOREIGN KEY (staff_member) REFERENCES staff(id)
);

CREATE TABLE if not exists solution (
	user INTEGER,
	value VARCHAR
);







